column3:
At the GWS, you can connect with people all
over the world through the internet to conduct
{pageend:Pokémon Wonder Trades.}
When a Wonder Trade is complete, an icon of a
{pageend:Pokémon will appear on the globe.}
You’ll collect rewards as you fill more points on
{pageend:the globe with icons!}
Keep making Wonder Trades to complete your
very own globe!

To make a Wonder Trade, first select a Pokémon
{pageend:you want to trade.}
Be warned that there are some Pokémon you
{pageend:can’t trade, though.}
{pageend:Next, choose any point you like on the globe.}
For example, it could be a place where you think
{pageend:your chosen Pokémon might live.}
When the Wonder Trade is complete, an icon of
your trade partner’s Pokémon will appear on
{pageend:your globe.}
Likewise, your Pokémon’s icon will appear on
{pageend:your trade partner’s globe.}
You won’t know what Pokémon you’ll receive
{pageend:until it arrives.}
I think that’s pretty exciting!

As you make more Wonder Trades, you can view
{pageend:the points on the globe you’re filling in.}
Each point marked on the globe can hold records
{pageend:of up to five Pokémon.}
You can change the Pokémon icon shown or
{pageend:delete records.}
You can also spin the globe, or enlarge or shrink
it, so go ahead and try it out!
